import Nav from './NavItem';
import{ useState } from 'react';
import './navbar.css';
import {IconContext} from 'react-icons'
import { BsBell , BsChatDots , BsCalendar , BsThreeDots} from "react-icons/bs";
import { HiOutlineUserGroup , HiOutlineShoppingBag } from "react-icons/hi";
import { IoCallOutline , IoHelpCircleSharp , IoHelpCircleOutline } from "react-icons/io5";
import { AiOutlineFile , AiOutlineAppstoreAdd } from "react-icons/ai";

function Navbar(){
    var classes="icon"
    function onMouseOver(){
        classes="icon active"
    }
    return(
        <IconContext.Provider value={ {color:"white" , size:"1.3em" } }>
            <div className='Navbar-wrapper'>
            <div className='Navbar-topitem'>
                <Nav icon={<BsBell/>} title='Activity'/> 
                <Nav icon={<BsChatDots/>} title='Chats'/>
                <Nav icon={<HiOutlineUserGroup/>} title='Teams'/>
                <Nav icon={<HiOutlineShoppingBag/>} title='Assignments'/>
                <Nav icon={<BsCalendar/>} title='Calendar'/>
                <Nav icon={<IoCallOutline/>} title='Calls'/>
                <Nav icon={<AiOutlineFile/>} title='Files'/>
                <Nav icon={<BsThreeDots/>} title=''/>

            </div>
            <div className='Navbar-bottomitem'>
                <Nav icon={<AiOutlineAppstoreAdd/>} title='Apps'/>
                <Nav icon={<i><IoHelpCircleOutline onMouseMove={onMouseOver}/><IoHelpCircleSharp color="blue" /></i>} title='Help'/>

            </div>

        </div>
        </IconContext.Provider>

    );
}

export default Navbar;
